import { useRouter } from 'next/router';
import Layout from '../components/Layout';

export default function Post() {
  const router = useRouter();

  return (
    <Layout>
      <div className="detail-news">
        <h1 className="font-30 text-center has-text-weight-semibold ">
          Saling Ejek, Nelayan Pasuruan Dibacok di Sidoarjo
        </h1>
        <div className="container text-center m-v-10">
          <img src="https://api.jatimnet.com/jinet/assets/media/news/news/image_front/ilustrasi_carok.png" className="w-75" />
          <p>This is the blog post content.</p>
        </div>
      </div>
    </Layout>
  );
}
